	/// <summary>
	/// 成员数
	/// </summary>
	public int memberNum;
	
	/// <summary>
	/// 公告
	/// </summary>
	public string notice;
	
	public RoleGroupSimpleData()
	{
		_dataID=BaseDataType.RoleGroupSimple;
	}
	
	/// <summary>
	/// 获取数据类名
